import React from 'react'

const GoalPassFail = ({current: { name, duration, startDate, type, units, total, privacy, compId, tracker, completed, }}) => {

  let time = moment().startOf('day').diff(startDate, 'days') + 1;

  return (
    <ul>
      <li>Total: XX {units}</li>
      <li>Day: {time} / {duration}</li>
      <li>You are XX% finished with your goal.</li>
    </ul>
  )
}

export default GoalPassFail;
